INSERT INTO `field_body` (`pages_id`, `data`, `data1012`, `data1044`, `data1045`, `data1046`, `data1047`, `data1048`, `data1049`, `data1050`, `data1051`, `data1052`, `data1053`, `data1054`, `data1055`, `data1056`, `data1057`, `data1058`, `data1059`, `data1060`) VALUES('1', '<p>This site profile for ProcessWire offers a simple, multilingual and responsive blog which doesn\'t require any module. It works exclusively with some template files.</p>', '<p>Dieses Site-Profil für ProcessWire bietet ein einfaches, mehrsprachiges und responsives Blog, welches kein Modul erfordert. Es funktioniert ausschließlich mit einigen Vorlagendateien.</p>', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '');
INSERT INTO `field_body` (`pages_id`, `data`, `data1012`, `data1044`, `data1045`, `data1046`, `data1047`, `data1048`, `data1049`, `data1050`, `data1051`, `data1052`, `data1053`, `data1054`, `data1055`, `data1056`, `data1057`, `data1058`, `data1059`, `data1060`) VALUES('27', '<h3>The page you were looking for is not found.</h3>\n\n<p>Please use our search engine or navigation above to find the page.</p>', '<h3>Die Seite, die Sie suchen, wurde nicht gefunden.</h3>\n\n<p>Bitte verwenden Sie die Suchmaschine oder die Navigation oben, um die Seite zu finden.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `field_body` (`pages_id`, `data`, `data1012`, `data1044`, `data1045`, `data1046`, `data1047`, `data1048`, `data1049`, `data1050`, `data1051`, `data1052`, `data1053`, `data1054`, `data1055`, `data1056`, `data1057`, `data1058`, `data1059`, `data1060`) VALUES('1023', '<p>This page lists all categories which have posts.</p>', '<p>Auf dieser Seite sind alle Kategorien aufgelistet, welche veröffentlichte Beiträge haben.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `field_body` (`pages_id`, `data`, `data1012`, `data1044`, `data1045`, `data1046`, `data1047`, `data1048`, `data1049`, `data1050`, `data1051`, `data1052`, `data1053`, `data1054`, `data1055`, `data1056`, `data1057`, `data1058`, `data1059`, `data1060`) VALUES('1024', '<p>This page lists all published posts.</p>', '<p>Auf dieser Seite sind alle veröffentlichten Beiträge aufgelistet.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `field_body` (`pages_id`, `data`, `data1012`, `data1044`, `data1045`, `data1046`, `data1047`, `data1048`, `data1049`, `data1050`, `data1051`, `data1052`, `data1053`, `data1054`, `data1055`, `data1056`, `data1057`, `data1058`, `data1059`, `data1060`) VALUES('1025', '<p>This site profile is intended for use with a new installation of ProcessWire.</p>\n\n<ol><li><a href=\"https://processwire.com/download/core/\" target=\"_blank\" rel=\"noreferrer noopener\">Download ProcessWire</a>, extract all files and folders and upload it into your web server folder.</li>\n	<li><a href=\"https://processwire.com/modules/site-simple-blog-multilanguage/\" target=\"_blank\" rel=\"noreferrer noopener\">Download the site profile</a>, extract the \"site-simple-blog-multilanguage\" folder and upload it into the same folder.</li>\n	<li>Start the installation.</li>\n	<li>When prompted for Site Installation Profile select **Simple and Multilingual Blog Profile for ProcessWire 3x** and continue with installation.</li>\n</ol><p><img alt=\"\" class=\"align_center\"	src=\"/site/assets/files/1025/installation.jpg\" width=\"500\" /></p>', '<p>Dieses Site-Profil ist für die Verwendung mit einer Neuinstallation von ProcessWire vorgesehen.</p>\n\n<ol><li><a href=\"https://processwire.com/download/core/\" target=\"_blank\" rel=\"noreferrer noopener\">Laden Sie ProcessWire herunter</a>, extrahieren Sie alle Dateien und Ordner und laden Sie diese in den Webserverordner hoch.</li>\n	<li><a href=\"https://processwire.com/modules/site-simple-blog-multilanguage/\" target=\"_blank\" rel=\"noreferrer noopener\">Laden Sie das Site-Profil herunter</a>, extrahieren Sie den Ordner \"site-simple-blog-multilanguage\" und laden Sie ihn in den selben Webserverordner.</li>\n	<li>Starten Sie die Installation.</li>\n	<li>Wenn Sie zur Eingabe des Site-Installationsprofils aufgefordert werden, wählen Sie \"Simple and Multilingual Blog Profile for ProcessWire 3x\" und fahren Sie mit der Installation fort.</li>\n</ol><p><img alt=\"\" class=\"align_center\"	src=\"/site/assets/files/1025/installation.jpg\" width=\"500\" /></p>', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '');
INSERT INTO `field_body` (`pages_id`, `data`, `data1012`, `data1044`, `data1045`, `data1046`, `data1047`, `data1048`, `data1049`, `data1050`, `data1051`, `data1052`, `data1053`, `data1054`, `data1055`, `data1056`, `data1057`, `data1058`, `data1059`, `data1060`) VALUES('1026', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `field_body` (`pages_id`, `data`, `data1012`, `data1044`, `data1045`, `data1046`, `data1047`, `data1048`, `data1049`, `data1050`, `data1051`, `data1052`, `data1053`, `data1054`, `data1055`, `data1056`, `data1057`, `data1058`, `data1059`, `data1060`) VALUES('1027', '<p>This page lists all published posts in a tree structure sorted by published date.</p>', '<p>Auf dieser Seite sind alle veröffentlichten Beiträge in einer Baumstruktur aufgelistet und sortiert nach Veröffentlichungsdatum.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `field_body` (`pages_id`, `data`, `data1012`, `data1044`, `data1045`, `data1046`, `data1047`, `data1048`, `data1049`, `data1050`, `data1051`, `data1052`, `data1053`, `data1054`, `data1055`, `data1056`, `data1057`, `data1058`, `data1059`, `data1060`) VALUES('1028', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `field_body` (`pages_id`, `data`, `data1012`, `data1044`, `data1045`, `data1046`, `data1047`, `data1048`, `data1049`, `data1050`, `data1051`, `data1052`, `data1053`, `data1054`, `data1055`, `data1056`, `data1057`, `data1058`, `data1059`, `data1060`) VALUES('1029', '<p>Don\'t forget to specify the receiver email address on the contact page in the backend.</p>', '<p>Vergessen Sie nicht, die E-Mail-Adresse des Empfängers auf der Kontaktseite im Backend anzugeben.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `field_body` (`pages_id`, `data`, `data1012`, `data1044`, `data1045`, `data1046`, `data1047`, `data1048`, `data1049`, `data1050`, `data1051`, `data1052`, `data1053`, `data1054`, `data1055`, `data1056`, `data1057`, `data1058`, `data1059`, `data1060`) VALUES('1030', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `field_body` (`pages_id`, `data`, `data1012`, `data1044`, `data1045`, `data1046`, `data1047`, `data1048`, `data1049`, `data1050`, `data1051`, `data1052`, `data1053`, `data1054`, `data1055`, `data1056`, `data1057`, `data1058`, `data1059`, `data1060`) VALUES('1031', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `field_body` (`pages_id`, `data`, `data1012`, `data1044`, `data1045`, `data1046`, `data1047`, `data1048`, `data1049`, `data1050`, `data1051`, `data1052`, `data1053`, `data1054`, `data1055`, `data1056`, `data1057`, `data1058`, `data1059`, `data1060`) VALUES('1032', '<p>There are no settings for this blog. Everything is ready after installation. You just have to fill it with content and maybe add some new pages. The theme can be changed as <a	href=\"/en/posts/theme/\">described here</a>.</p>', '<p>Es gibt keine Einstellungen für diesen Blog. Nach der Installation ist alles fertig. Sie müssen es nur mit Inhalten füllen und möglicherweise einige neue Seiten hinzufügen. Das Thema kann wie <a	href=\"/de/posts/theme/\">hier beschrieben</a> geändert werden.</p>', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '');
INSERT INTO `field_body` (`pages_id`, `data`, `data1012`, `data1044`, `data1045`, `data1046`, `data1047`, `data1048`, `data1049`, `data1050`, `data1051`, `data1052`, `data1053`, `data1054`, `data1055`, `data1056`, `data1057`, `data1058`, `data1059`, `data1060`) VALUES('1033', '<p>The whole blog consists of the following templates:</p>\n\n<ol><li><strong>Home page</strong> (Template: simple-blog-home)<br />\n	This page shows the latest 5 posts below the content.</li>\n	<li><strong>Posts page</strong> (Template: simple-blog-posts)<br />\n	This page lists all published posts. Hidden posts are not listed. Posts are sorted by published date. The latest posts are shown first in the list. All posts are paginated to 10 posts per page.</li>\n	<li><strong>Post page</strong> (Template: simple-blog-post)<br />\n	This page shows the content and a comment list with comment form provided by the FieldtypeComments which is shipped with ProcessWire.</li>\n	<li><strong>Categories page</strong> (Template: simple-blog-categories)<br />\n	This page lists all categories which have posts.</li>\n	<li><strong>Category page</strong> (Template: simple-blog-category)<br />\n	This page lists all posts in this category. Hidden posts are not listed.</li>\n	<li><strong>Archive page</strong> (Template: simple-blog-archive)<br />\n	This page lists all published posts in a tree structure sorted by published date. Hidden posts are not listed.</li>\n	<li><strong>Search page</strong> (Template: simple-search)<br />\n	This page offers a search form.</li>\n	<li><strong>Contact page</strong> (Template: simple-contact-form)<br />\n	This page offers a contact form.</li>\n</ol><p><img alt=\"\" class=\"align_center\"	src=\"/site/assets/files/1033/structure.jpg\" width=\"500\" /></p>', '<p>Der gesamte Blog besteht aus einigen Vorlagenseiten:</p>\n\n<ol><li><strong>Home-Seite</strong> (Vorlage: simple-blog-home)<br />\n	Diese Seite zeigt die letzten 5 Beiträge unter dem Inhalt.</li>\n	<li><strong>Beiträge-Seite</strong> (Vorlage: simple-blog-posts)<br />\n	Diese Seite listet alle veröffentlichten Beiträge auf. Versteckte Beiträge werden nicht aufgelistet. Die Beiträge sind nach Veröffentlichungsdatum sortiert. Die neuesten Beiträge werden zuerst in der Liste angezeigt. Alle Beiträge sind auf 10 Beiträge pro Seite paginiert.</li>\n	<li><strong>Beitrag-Seite</strong> (Vorlage: simple-blog-post)<br />\n	Diese Seite zeigt den Inhalt und eine Kommentarliste mit einem Kommentarformular, das von FieldtypeComments bereitgestellt wird und mit ProcessWire geliefert wird.</li>\n	<li><strong>Kategorien-Seite</strong> (Vorlage: simple-blog-categories)<br />\n	Diese Seite listet alle Kategorien auf, die Beiträge haben.</li>\n	<li><strong>Kategorie-Seite</strong> (Vorlage: simple-blog-category)<br />\n	Diese Seite listet alle Beiträge in dieser Kategorie auf. Versteckte Beiträge werden nicht aufgelistet.</li>\n	<li><strong>Archivseite</strong> (Vorlage: simple-blog-archive)<br />\n	Diese Seite listet alle veröffentlichten Beiträge in einer Baumstruktur auf, sortiert nach Veröffentlichungsdatum. Versteckte Beiträge werden nicht aufgelistet.</li>\n	<li><strong>Suchseite</strong> (Vorlage: simple-search)<br />\n	Diese Seite bietet ein Suchformular.</li>\n	<li><strong>Kontaktseite</strong> (Vorlage: simple-contact-form)<br />\n	Diese Seite bietet ein Kontaktformular.</li>\n</ol><p><img alt=\"\" class=\"align_center\"	src=\"/site/assets/files/1033/structure.jpg\" width=\"500\" /></p>', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '');
INSERT INTO `field_body` (`pages_id`, `data`, `data1012`, `data1044`, `data1045`, `data1046`, `data1047`, `data1048`, `data1049`, `data1050`, `data1051`, `data1052`, `data1053`, `data1054`, `data1055`, `data1056`, `data1057`, `data1058`, `data1059`, `data1060`) VALUES('1034', '<p>Open the page structure, select \"Posts\" and click \"New\".</p>\n\n<p><img alt=\"\" class=\"align_center\"	src=\"/site/assets/files/1034/add-new-post-1.jpg\" width=\"500\" /></p>\n\n<p>Make sure that \"simple-blog-post\" is selected as template.</p>\n\n<p><img alt=\"\" class=\"align_center\"	src=\"/site/assets/files/1034/add-new-post-2.jpg\" width=\"500\" /></p>', '<p>Öffnen Sie die Seitenstruktur, wählen Sie \"Beiträge\" und klicken Sie auf \"Neu\".</p>\n\n<p><img alt=\"\" class=\"align_center\"	src=\"/site/assets/files/1034/add-new-post-1.jpg\" width=\"500\" /></p>\n\n<p>Stellen Sie sicher, dass \"simple-blog-post\" als Vorlage ausgewählt ist.</p>\n\n<p><img alt=\"\" class=\"align_center\"	src=\"/site/assets/files/1034/add-new-post-2.jpg\" width=\"500\" /></p>', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '');
INSERT INTO `field_body` (`pages_id`, `data`, `data1012`, `data1044`, `data1045`, `data1046`, `data1047`, `data1048`, `data1049`, `data1050`, `data1051`, `data1052`, `data1053`, `data1054`, `data1055`, `data1056`, `data1057`, `data1058`, `data1059`, `data1060`) VALUES('1035', '<p>The post list shows a featured graphic in front of every post. This graphic is taken from the first available image in the image field of the respective post. Note that you can change the order of images in the image field by dragging it to another position. The image should have the dimension of 96x96 px.</p>', '<p>Die Beitragsliste zeigt eine Präsentationsgrafik vor jedem Beitrag. Diese Grafik stammt aus dem ersten verfügbaren Bild in Images des jeweiligen Beitrags. Beachten Sie, dass Sie die Reihenfolge der Bilder in Images durch ziehen an eine andere Position ändern können. Das Bild sollte die Größe 96x96 px haben.</p>', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '');
INSERT INTO `field_body` (`pages_id`, `data`, `data1012`, `data1044`, `data1045`, `data1046`, `data1047`, `data1048`, `data1049`, `data1050`, `data1051`, `data1052`, `data1053`, `data1054`, `data1055`, `data1056`, `data1057`, `data1058`, `data1059`, `data1060`) VALUES('1036', '<p>Before you can select categories you have to create it. Open the page structure, select \"Categories\" and click \"New\".</p>\n\n<p><img alt=\"\" class=\"align_center\"	src=\"/site/assets/files/1036/create-category-1.357x0-is.jpg\" width=\"357\" /></p>\n\n<p>Make sure that \"simple-blog-category\" is selected as template. The page title specifies the category name.</p>\n\n<p><img alt=\"\" class=\"align_center\"	src=\"/site/assets/files/1036/create-category-2.jpg\" width=\"500\" /></p>\n\n<p>Open your post and click on \"Add\" in the Categories field and select a category.</p>\n\n<p><img alt=\"\" class=\"align_center\"	src=\"/site/assets/files/1036/select-category.jpg\" width=\"500\" /></p>', '<p>Bevor Sie Kategorien auswählen können, müssen Sie diese erst erstellen. Öffnen Sie die Seitenstruktur, wählen Sie \"Kategorien\" und klicken Sie auf \"Neu\".</p>\n\n<p><img alt=\"\" class=\"align_center\"	src=\"/site/assets/files/1036/create-category-1.357x0-is.jpg\" width=\"357\" /></p>\n\n<p>Stellen Sie sicher, dass \"simple-blog-category\" als Vorlage ausgewählt ist. Der Seitentitel gibt den Kategorienamen an.</p>\n\n<p><img alt=\"\" class=\"align_center\"	src=\"/site/assets/files/1036/create-category-2.jpg\" width=\"500\" /></p>\n\n<p>Öffnen Sie Ihren Beitrag und klicken Sie im Feld Kategorien auf \"Hinzufügen\" und wählen Sie eine Kategorie aus.</p>\n\n<p><img alt=\"\" class=\"align_center\"	src=\"/site/assets/files/1036/select-category.jpg\" width=\"500\" /></p>', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '');
INSERT INTO `field_body` (`pages_id`, `data`, `data1012`, `data1044`, `data1045`, `data1046`, `data1047`, `data1048`, `data1049`, `data1050`, `data1051`, `data1052`, `data1053`, `data1054`, `data1055`, `data1056`, `data1057`, `data1058`, `data1059`, `data1060`) VALUES('1037', '<p>Each page can have a sidebar regardless of the page type. Just open the page, click in the sidebar field and fill it with content. The sidebar is displayed on right from the body content if the browser window is 775px or wider. If smaller than 775px the sidebar will be displayed below the body content.</p>', '<p>Jede Seite kann, unabhängig vom Seitentyp, eine Seitenleiste haben. Öffnen Sie einfach die Seite, klicken Sie in das Seitenleistenfeld und füllen Sie es mit Inhalt. Die Seitenleiste wird rechts vom Hauptteil angezeigt, wenn das Browserfenster 775px oder mehr groß ist. Bei einer Größe von weniger als 775px wird die Seitenleiste unterhalb des Hauptteils angezeigt.</p>', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '');
INSERT INTO `field_body` (`pages_id`, `data`, `data1012`, `data1044`, `data1045`, `data1046`, `data1047`, `data1048`, `data1049`, `data1050`, `data1051`, `data1052`, `data1053`, `data1054`, `data1055`, `data1056`, `data1057`, `data1058`, `data1059`, `data1060`) VALUES('1038', '<p>Posts are sorted by published date and paginated to 10 posts per page.</p>\n\n<p><img alt=\"\" class=\"align_center\"	src=\"/site/assets/files/1038/pagination.jpg\" width=\"500\" /></p>', '<p>Beitragslisten werden nach Veröffentlichungsdatum sortiert und auf 10 Beiträge pro Seite paginiert.</p>\n\n<p><img alt=\"\" class=\"align_center\"	src=\"/site/assets/files/1038/pagination.jpg\" width=\"500\" /></p>', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '');
INSERT INTO `field_body` (`pages_id`, `data`, `data1012`, `data1044`, `data1045`, `data1046`, `data1047`, `data1048`, `data1049`, `data1050`, `data1051`, `data1052`, `data1053`, `data1054`, `data1055`, `data1056`, `data1057`, `data1058`, `data1059`, `data1060`) VALUES('1039', '<p>Before you can use the contact form you have to specify the receiver email address. Open the page structure, select \"Contact\" and click \"Edit\". Enter the email address in the \"E-Mail Address\" field. You can also specify your \"Recaptcha-Site-Key\" and \"Recaptcha-Secret-Key\" to protect the form with Recaptcha.</p>\n\n<p><img alt=\"\" class=\"align_center\"	src=\"/site/assets/files/1039/contact-form.jpg\" width=\"500\" /></p>', '<p>Bevor Sie das Kontaktformular verwenden können, müssen Sie die E-Mail-Adresse des Empfängers angeben. Öffnen Sie die Seitenstruktur, wählen Sie \"Kontaktformular\" und klicken Sie auf \"Bearbeiten\". Geben Sie die E-Mail-Adresse in das Feld \"E-Mail-Adresse\" ein. Sie können auch Ihren \"Recaptcha-Site-Key\" und \"Recaptcha-Secret-Key\" angeben, um das Formular mit Recaptcha zu schützen.</p>\n\n<p><img alt=\"\" class=\"align_center\"	src=\"/site/assets/files/1039/contact-form.jpg\" width=\"500\" /></p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `field_body` (`pages_id`, `data`, `data1012`, `data1044`, `data1045`, `data1046`, `data1047`, `data1048`, `data1049`, `data1050`, `data1051`, `data1052`, `data1053`, `data1054`, `data1055`, `data1056`, `data1057`, `data1058`, `data1059`, `data1060`) VALUES('1040', '<p>The theme can easily customized to your requirement. The logo is located in <a	href=\"/site/templates/images/header.png\" target=\"_blank\" rel=\"noreferrer noopener\">/site/templates/images/logo.png</a> and the main style in <a	href=\"/site/templates/styles/main.css\" target=\"_blank\" rel=\"noreferrer noopener\">/site/templates/styles/main.css</a>.</p>', '<p>Das Thema kann einfach an Ihre Anforderungen angepasst werden. Das Logo befindet sich in <a	href=\"/site/templates/images/headerbg.png\" target=\"_blank\" rel=\"noreferrer noopener\">/site/templates/images/logo.png</a> und der Hauptstil in <a	href=\"/site/templates/styles/main.css\" target=\"_blank\" rel=\"noreferrer noopener\">/site/templates/styles/main.css</a>.</p>', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '');
INSERT INTO `field_body` (`pages_id`, `data`, `data1012`, `data1044`, `data1045`, `data1046`, `data1047`, `data1048`, `data1049`, `data1050`, `data1051`, `data1052`, `data1053`, `data1054`, `data1055`, `data1056`, `data1057`, `data1058`, `data1059`, `data1060`) VALUES('1041', '<p>This site profile for ProcessWire is provided by: <a href=\"https://tech-c.net/posts/simple-multilingual-blog-profile-for-processwire/\" target=\"_blank\" rel=\"noreferrer noopener\">https://tech-c.net/</a></p>\n\n<p><a href=\"https://tech-c.net/donation/\" rel=\"nofollow noreferrer noopener\" target=\"_blank\"><img alt=\"\" class=\"align_center\"	src=\"/site/assets/files/1041/donate.png\" /></a></p>', '<p>Dieses Site-Profil für ProcessWire wird bereitgestellt von: <a href=\"https://tech-c.net/\" target=\"_blank\" rel=\"noreferrer noopener\">https://tech-c.net/</a></p>\n\n<p><a href=\"https://tech-c.net/donation/\" rel=\"nofollow noreferrer noopener\" target=\"_blank\"><img alt=\"\" class=\"align_center\"	src=\"/site/assets/files/1041/donate.png\" /></a></p>', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '');
