INSERT INTO `field_body` (`pages_id`, `data`, `data1012`, `data1044`, `data1045`, `data1046`, `data1047`, `data1048`, `data1049`, `data1050`, `data1051`, `data1052`, `data1053`, `data1054`, `data1055`, `data1056`, `data1057`, `data1058`, `data1059`, `data1060`) VALUES('1069', '<p>The menu is automatically generated from the available pages below the root, which are:</p>\n\n<ol><li>set to visible</li>\n	<li>are published</li>\n	<li>have a \"Menu text\"</li>\n</ol><p>The same rule applies to the \"Quick Links\" in the footer. If the page images containing an image with the name \"menu-image.png\", then this image will be used in the responsive menu.</p>\n\n<p><img alt=\"\" class=\"align_center\"	src=\"/site/assets/files/1069/menu.jpg\" width=\"500\" /></p>', '<p>Das Menü wird automatisch von den verfügbaren Seiten unterhalb von Root generiert, und:</p>\n\n<ol><li>auf sichtbar gestellt</li>\n	<li>sind veröffentlicht</li>\n	<li>haben ein \"Menu text\"</li>\n</ol><p>Dieselbe Regel gilt für die \"Quick Links\" in der Fußzeile. Wenn in den Seitenbilder ein Bild mit dem Namen \"menu-image.png\" enthalten ist, dann wird dieses Bild im responsiven Menü verwendet. </p>\n\n<p><img alt=\"\" class=\"align_center\"	src=\"/site/assets/files/1069/menu.jpg\" width=\"500\" /></p>', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '');
INSERT INTO `field_body` (`pages_id`, `data`, `data1012`, `data1044`, `data1045`, `data1046`, `data1047`, `data1048`, `data1049`, `data1050`, `data1051`, `data1052`, `data1053`, `data1054`, `data1055`, `data1056`, `data1057`, `data1058`, `data1059`, `data1060`) VALUES('1070', '<p>Each page field is available in each installed language. If the field is empty, the value is taken from the default language.</p>\n\n<p><img alt=\"\" class=\"align_center\"	src=\"/site/assets/files/1070/language-1.jpg\" width=\"500\" /></p>\n\n<p>Languages can be added or removed under Setup=&gt;Languages.</p>\n\n<p><img alt=\"\" class=\"align_center\"	src=\"/site/assets/files/1070/language-2.jpg\" width=\"500\" /></p>', '<p>Jedes Seitenfeld ist in jeder installierten Sprache verfügbar. Wenn das Feld leer ist, wird der Wert von der Standardsprache übernommen.</p>\n\n<p><img alt=\"\" class=\"align_center\"	src=\"/site/assets/files/1070/language-1.jpg\" width=\"500\" /></p>\n\n<p>Sprachen können unter Setup=&gt;Languages hinzugefügt oder entfernt werden.</p>\n\n<p><img alt=\"\" class=\"align_center\"	src=\"/site/assets/files/1070/language-2.jpg\" width=\"500\" /></p>', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '');
